import React, { Component } from 'react';
import Read from '../../../images/icons/book.svg'

class ButtonGroup extends Component {
    render() {
        return (
            <td>
                <div className="row" width={10} height="10" >
                <button className="btn">
                    <img src={Read}/>
                </button>
                <button className="btn">
                    <img src={Read}/>
                </button>

                </div>
                
                
            </td>

        );
    }
}

export default ButtonGroup;
